// F:\landinghub-iconic\apps\web\src\pages\Dashboard.js
import React from 'react';
import { useParams } from 'react-router-dom';

const Dashboard = () => {
    const { role } = useParams(); // Lấy role từ URL

    // Hiển thị nội dung dựa trên role
    const renderContent = () => {
        switch (role) {
            case 'admin':
                return (
                    <div>
                        <h1>Admin Dashboard</h1>
                        <p>Chào mừng Admin! Quản lý hệ thống tại đây.</p>
                    </div>
                );
            case 'user':
                return (
                    <div>
                        <h1>User Dashboard</h1>
                        <p>Chào mừng User! Quản lý tài khoản của bạn tại đây.</p>
                    </div>
                );
            default:
                return <h1>Dashboard không hợp lệ</h1>;
        }
    };

    return (
        <div>
            <h2>Dashboard</h2>
            {renderContent()}
        </div>
    );
};

export default Dashboard;
